    "Times New Roman"'>Both my sister and brother attended Assumption

    <p class=MsoNormal><span style='font-size:10.0pt;line-height:107%'><o:p>&nbsp;</o:p></span></p>

    "Times New Roman";color:black'>What is career, you love to do in the future?</span></b><b><span

    line-height:107%;font-family:"Times New Roman","serif";mso-fareast-font-family:
    "Times New Roman"'>I would love to be a software developer once I graduate

height:775px"><img width="978" height="775" src="Why%20AU%20in%20Your%20View_01Jess77777_files/image007.png" alt="Text Box: Why did you come to study in Thailand ?
The reason I come to Thailand is because I always wanted to study abroad for my university and Thailand is right next to my country which is convenient for me to go home anytime I want.

WHY DO YOU CHOSE ASSUMPTION UNIVERSITY?
Both my sister and brother attended Assumption University so they told me about their experiences here. They told me that the professors here are great and it was a big campus. They seem like they have enjoyed their university life here so it made me want to come here.

WHAT IS CAREER, YOU LOVE TO DO IN THE FUTURE?
I would love to be a software developer once I graduate university. We have to program and build software that meets the use of users. I am good at problem solving skills and math which is essential to be a software developer.
What kind of social volunteer you want to do if you have a chance?
I want to teach kids who are in an orphanage and give them the education that they should get. I want to teach them about all the basics stuff and give them life lessons.
